import Logo from './components/Logo'
import Menu from './components/Menu'
import Sidebar from './components/Sidebar'

function App() {
  return (
    <div>
      <Logo />
      <Header />
      <Footer title="Google" website='www.google.com' postcode={70110} isOpen={false} />
      <hr/>
      <Sidebar />
      <hr/>
      <Menu />
    </div>
  );
}

export default App
